import React from 'react';
import './App.css';
import ToDoList from "./ToDoList";


function App() {
    return (
        <div className="App">
            <ToDoList title={"What to learn"}/>
            <ToDoList title={"What to buy"}/>
            <ToDoList title={"What to do"}/>
        </div>
    );
}

export default App;
